„Paskutinės valandos pasiruošimo, kuris truko ne vieną mėnesį“, – šyptelėjo su DELFI bendravęs Andrius ir pridūrė, jog jis pats į areną atvyko per pietus, tačiau jo komanda dirbo visą naktį. Bilietais į Andriaus koncertą buvo pradėta prekiauti lygiai prieš metus, tad jis pats juokėsi, kad kai kurie jo gerbėjai, nusipirkę bilietus, atvyko į areną lygiai... Metais anksčiau. Beje, šįvakar arenoje jo koncertą stebės apie dvylika tūkstančių žmonių. Nebėra nė vieno bilieto, nors į koncertą Kaune dar galima įsigyti kelis likusius. Ar A. Mamontovas turi ritualą, kuris padeda nusiraminti prieš koncertą? „Kiekvieną rytą paglostau jūrų kiaulytę“, – nusijuokė atlikėjas, tačiau neslėpė, kad šiąnakt buvo sunku užmigti, nes galvoje sukosi daugybė minčių ir reikalų. „Galvoji, kad laikas miegoti, bet negali užmigti, kažkur pasąmonėje jaudiniese. Kažkur yra darbų seka, kažką reikia padaryti, sujungti, padėti. Kažkur giliai aišku, tas jaudulys yra. Pergyveni, kad viskas pavyktų, tai atsakomybė“, – kalbėjo Andrius. Daugiau kaip dvi valandas truksiančiame koncerte, į kurį jau seniai išpirkti visi bilietai, A. Mamontovo gerbėjai išgirs pačias populiariausias muzikanto dainas, sukurtas per 30 šalies muzikos scenoje praleistų metų. (function(d, s, i, r) {
