		})(document, 'script', 'facebook-jssdk', 'fb-root'); Atlikėjo koncertai Vilniuje ir Kaune – milžiniškas iššūkis ne tik didžiausioms Lietuvos koncertų salėms, bet ir visam technikos personalui. Šiems pasirodymams sukurtos specialios dekoracijos, o šviesų ir prožektorių skaičius bus didžiausias, iki šiol buvęs mūsų šalyje uždaro renginio metu. Tam, kad būtų įgyvendinti visi atlikėjo sumanymai, scenos įrengimo darbai sekmadienio vakaro koncertui prasidėjo dar ankstyvą šeštadienio rytą. Visų pasirodymo detalių nenorintis atskleisti  Andrius Mamontovas  prisipažįsta, kad ant scenos drauge su muzikantais lips ir renginio svečiai. Grupės „Lemon Joy” lyderis Igoris Kofas – tik vienas iš jų. Andrius Mamontovas atskleidžia, kad kai kurie koncerte atlikti kūriniai skambės taip, kaip dar niekada nėra skambėję, o kelios dainos turėtų būti sugrotos netgi ne pačioje scenoje, o kitose arenos erdvėse. Planuojama, kad koncerto metu nuskambės daugiau kaip 20 kūrinių. Tai kompozicijos, kurias Andrius Mamontovas sukūrė drauge su grupe  „Foje”  bei savo solinės karjeros metu. Andriaus Mamontovo muzikinė karjera prasidėjo prieš 34 metus Antakalnio vidurinėje mokykloje. Čia jis drauge su bendraminčiais sukūrė grupę „Sunki muzika“, kuri neilgai trukus buvo pavadinta „Foje“. Per 14 savo gyvavimo metų kultinis šalies kolektyvas išleido 9 studijinius, 3 koncertinius ir kelis geriausių dainų albumus. „Foje” laimėjo visus įmanomus to meto muzikinius apdovanojimus. Iki šiol oficialiai yra parduota daugiau kaip 200 000 šios grupės albumų kopijų - tai yra vienas geriausių rezultatų nepriklausomoje Lietuvoje. Surengusi didžiausią visų laikų koncertą mūsų šalyje, grupė „Foje” iširo 1997 metais. Paskutinio vilniečių pasirodymo sostinėje klausėsi 60 tūkst. žmonių. Šio pasiekimo iki šiol nėra pavykę pakartoti nė vienai Lietuvos grupei. Dar būdamas grupės „Foje” nariu Andrius Mamontovas pradėjo savo solinę karjerą. Pirmas jo solinis debiutas – 1995 metais išleistas albumas „Pabėgimas” – iki šiol vadinamas vienu geriausių Lietuvos albumų. Daugiau kaip 30 metų aktyviai muzikinėje veikloje dalyvaujančio atlikėjo diskografijoje – 15 studijinių solinių plokštelių ir dar 21 muzikinis apdovanojimas. Šiemet penkiasdešimtmetį švenčiantis Andrius Mamontovas yra apdovanotas ordino „Už nuopelnus Lietuvai medaliu”, Santarvės ordinu „Pro augenda concordia“, auksine „Jin-Jue“ taure tarptautiniame Šanchajaus kino festivalyje. Atlikėjas taip pat suvaidino 4 pilno metro filmuose, o Eimunto Nekrošiaus spektaklyje atliko pagrindinį – „Hamleto” vaidmenį.
